[{"location":"Optimization/参数辨识实例_MTK/#实例：MTK非线性参数辨识实例","page":"实例：MTK非线性参数辨识实例","title":"实例：MTK非线性参数辨识实例","text":"","category":"section"},{"location":"Optimization/参数辨识实例_MTK/","page":"实例：MTK非线性参数辨识实例","title":"实例：MTK非线性参数辨识实例","text":"tip: Tip\nContents：参数辨识、优化Contributor: YJYEmail:522432938@qq.com如有错误，请批评指正。","category":"page"},{"location":"Optimization/参数辨识实例_MTK/","page":"实例：MTK非线性参数辨识实例","title":"实例：MTK非线性参数辨识实例","text":"note: Note\nMTK = ModelingToolkit.jlNLP = NonlinearnProblem，非线性问题OptimizationSystem为MTK中的系统类型之一","category":"page"},{"location":"Optimization/参数辨识实例_MTK/#参数辨识概念","page":"实例：MTK非线性参数辨识实例","title":"参数辨识概念","text":"","category":"section"},{"location":"Optimization/参数辨识实例_MTK/","page":"实例：MTK非线性参数辨识实例","title":"实例：MTK非线性参数辨识实例","text":"系统中的参数作为优化变量，找到一组参数，使得通过模型计算结果与实际值误差最小，实际值一般为一系列数值。参数辨识本质为回归问题。数学表达如下：","category":"page"},{"location":"Optimization/参数辨识实例_MTK/","page":"实例：MTK非线性参数辨识实例","title":"实例：MTK非线性参数辨识实例","text":"y = f(ab)\r\nmin (y_real - y)^2","category":"page"},{"location":"Optimization/参数辨识实例_MTK/#实例","page":"实例：MTK非线性参数辨识实例","title":"实例","text":"","category":"section"},{"location":"Optimization/参数辨识实例_MTK/","page":"实例：MTK非线性参数辨识实例","title":"实例：MTK非线性参数辨识实例","text":"考虑下面的模型：","category":"page"},{"location":"Optimization/参数辨识实例_MTK/","page":"实例：MTK非线性参数辨识实例","title":"实例：MTK非线性参数辨识实例","text":"y = ax^2+sin(bx)a=15b=08","category":"page"},{"location":"Optimization/参数辨识实例_MTK/","page":"实例：MTK非线性参数辨识实例","title":"实例：MTK非线性参数辨识实例","text":"采用生成数据的方法构造真实的数据y_real。 方法为通过模型计算出准确值并加上随机误差。","category":"page"},{"location":"Optimization/参数辨识实例_MTK/","page":"实例：MTK非线性参数辨识实例","title":"实例：MTK非线性参数辨识实例","text":"##### 生成真实数据 ####\r\nx = collect(-1:0.01:1)\r\nN = length(x)\r\n# 产生随机误差，范围在-0.1~0.1之间\r\nrands = rand(-0.1:0.01:0.1, N)\r\na1 = 1.5\r\na2 = 0.8\r\n# 计算y值\r\ny = @. a1 * x^2 + sin(a2 * x) + rands\r\n","category":"page"},{"location":"Optimization/参数辨识实例_MTK/","page":"实例：MTK非线性参数辨识实例","title":"实例：MTK非线性参数辨识实例","text":"因为测试数据集y_real本身即来自模型，同时添加的扰动范围不大，可以认为数据集的内涵就是模型y = ax^2+sin(bx) 接下来构建问题并且求解：","category":"page"},{"location":"Optimization/参数辨识实例_MTK/","page":"实例：MTK非线性参数辨识实例","title":"实例：MTK非线性参数辨识实例","text":"# 计算损失Loss\r\n@variables para[1:2]\r\nerrors = @. (para[1] * x^2 + sin(para[2] * x) - y)^2\r\n\r\n# 计算方差和，采用均方差亦可\r\nLoss = sum(errors)\r\n\r\n# 构建问题并求解\r\n@named sys = OptimizationSystem(Loss, [para[i] for i in 1:2], [])\r\na0 = [0.1,0.1]\r\nprob = OptimizationProblem(sys, a0, [], grad=true, hess=true, reltol=1e-8, abstol=1e-8)\r\ns = solve(prob, Optim.Newton())","category":"page"},{"location":"Optimization/参数辨识实例_MTK/","page":"实例：MTK非线性参数辨识实例","title":"实例：MTK非线性参数辨识实例","text":"最后的结果为:","category":"page"},{"location":"Optimization/参数辨识实例_MTK/","page":"实例：MTK非线性参数辨识实例","title":"实例：MTK非线性参数辨识实例","text":"u: 2-element Vector{Float64}:\r\n 1.502064883762093\r\n 0.7908724806965902","category":"page"},{"location":"Optimization/参数辨识实例_MTK/","page":"实例：MTK非线性参数辨识实例","title":"实例：MTK非线性参数辨识实例","text":"和我们的真实值a=15b=08比较接近。 优化成功！","category":"page"},{"location":"Optimization/参数辨识实例_MTK/","page":"实例：MTK非线性参数辨识实例","title":"实例：MTK非线性参数辨识实例","text":"tip: Tip\n影响优化效果的因素有初值\n生成扰动大小可以尝试修改它们并查看求解效果。","category":"page"},{"location":"","page":"Home","title":"Home","text":"note: Note\n","category":"page"}]
